    setIndex(selectedIndex);
  };

  return (
    <div
      className="card container shadow-sm bg-transparent"
      style={{ width: '100', heigth: '100', marginTop: '1rem' }}
    >
      <CarouselItem index={index} handleSelect={handleSelect} />
    </div>
  );
};

export default Gallery;
